import "./App.css";
import NavBar from "./components/NavBar";
import GetCoffee from "./components/getCoffee";
import aboutOurCoffee from "./components/aboutOurCoffee";
import aboutCoffee from "./components/aboutCoffee";

function App() {
  return (
    <div className="App">
      <NavBar />

      <GetCoffee></GetCoffee>
      <aboutOurCoffee />
      <aboutOurCoffee></aboutOurCoffee>
      <aboutCoffee> f</aboutCoffee>

      <div className="bottom-border"></div>
    </div>
  );
}

export default App;
